%spark
import scala.collection.mutable.WrappedArray

def tagOrg(): (WrappedArray[String] => Boolean) = { temps =>
	var flag = false
	if (null == temps) {
		false
	} else {
		for (i <- temps) {
			if (i contains "organization") {
				flag = true
			}
		}
		flag
	}
}

val tagOrgBox = udf(tagOrg)

%spark
val wk_tagorg = wk_hasbox.withColumn("isOrg", tagOrgBox($"box_temp"))
