import org.json4s._
import org.json4s.jackson.Serialization.{read, write}

def getField(field: String): (String => String) = { jsonStr =>
	if (null == jsonStr || "" == jsonStr.trim) {
		null
	} else {
		var fieldVal = ""
		implicit val formats = DefaultFormats
		val boxLst = parse(jsonStr).extract[List[scala.collection.immutable.Map[String, String]]]
		for (box <- boxLst) {
			val boxMap = box
			if (boxMap.contains(field)) {
				fieldVal = boxMap.getOrElse(field, null)
			}
		}
		if (fieldVal.trim == "") {
			null
		} else {
			fieldVal.trim
		}
	}
}

val parentField = "parent_organization"
val getParent = udf(getField(parentField))
